        let [center_img, change_img] = useState(img1);
        let [center_name, change_name] = useState('스포애니 관악점');
        let [center_price, change_price] = useState("250,000KRW/MONTH");
        let [center_label, change_label] = useState('관악구');

function Create_Center(){
    const results = [];
    for (let i = 0 ; i < center_label_list.length ; i++){
        let copy_img = center_img_list[i];
        let copy_name = center_name_list[i];
